import React from 'react';
import styles from './Hero.module.scss';
// import video from '../../assets/videos/video1.mp4';
const Hero = () => {
  const video = '../../assets/videos/video1.mp4';

  return (
    <div className={styles.hero}>
      {/* Vídeo de máquinas de serras como background */}
      <div className={styles.videoBackground}>
        <video style={{}} autoPlay loop playsInline className={styles.video}>
          <source src={video} type="video/mp4" />
          Seu navegador não suporta a tag de vídeo.
        </video>
      </div>
      {/* Conteúdo sobreposto */}
      <div className={styles.content}>
        <h1>Serras para alto desempenho</h1>
        <p>Conheça nossos produtos e serviços de alta qualidade.</p>
        <div className={styles.buttonContainer}>
          <button className={styles.button}>Nossos produtos</button>
          <button>Fale conosco</button>
        </div>
      </div>
    </div>
  );
};

export default Hero;
